	return(
		<div className="collapse navbar-collapse" id="navbar-collapse-uarr">
      <ul className="nav navbar-nav navbar-right">
        <li><a href="." title="" className="active" id="home" onClick={props.handleClick}>Dom≈Ø</a></li>
        <li><a href="#about" title="" id="About" onClick={props.handleClick}> Informace</a></li>
        <li><a href="#contact" title="" id="contact" onClick={props.handleClick}>Kontakt</a></li>          
      </ul>
    </div>
	)
}

export default NavbarMenu;
